import numpy as np

def priority_v2(item: float, bins_remain_cap: np.ndarray, temperature: float = 1.0) -> np.ndarray:
    possible_bins = bins_remain_cap >= item
    if not np.any(possible_bins):
        return np.zeros_like(bins_remain_cap)

    bin_utilizations = bins_remain_cap[possible_bins] / bins_remain_cap[possible_bins].max()

    scores = np.exp((bins_remain_cap[possible_bins] - item) / temperature)

    priorities = np.zeros_like(bins_remain_cap)
    priorities[possible_bins] = scores / np.sum(scores)

    return priorities
